import Sidebar from "../components/Sidebar/Sidebar";
function LayoutDefault({children}) {
    return ( 
        <div>
            <Sidebar/>
            <section id="content">
                <nav className='nav-header'>
                    <i className="fas fa-list"></i>
                    <i className="fa-solid fa-user"></i>
                </nav>
                {children}
            </section>
        </div>
     );
}

export default LayoutDefault;
